import { ReactNode } from 'react';
import {
    Box,
    Flex,
    Avatar,
    HStack,
    Link,
    IconButton,
    Button,
    Menu,
    MenuButton,
    MenuList,
    MenuItem,
    MenuDivider,
    useDisclosure,
    useColorModeValue,
    Stack,
} from '@chakra-ui/react';

const Links = ['siparis', 'musteriler'];

const NavLink = ({ children }: { children: ReactNode }) => (
    <Link
        px={2}
        py={1}
        rounded={'md'}
        _hover={{
            textDecoration: 'none',
            bg: useColorModeValue('gray.200', 'gray.700'),
        }}
        href={'#'}>
        {children}
    </Link>
);

export default function Navbar() {
    const { isOpen, onOpen, onClose } = useDisclosure();

    return (
        <>
            <Box bg={'green.200'} px={4} className='navbar'>
                <Flex h={16} alignItems={'center'} justifyContent={'space-between'}>
                    <IconButton
                        size={'md'}
                        // icon={isOpen ? <CloseIcon /> : <HamburgerIcon />}
                        aria-label={'Open Menu'}
                        display={{ md: 'none' }}
                        onClick={isOpen ? onClose : onOpen}
                    />
                    <HStack spacing={8} alignItems={'center'}>
                        <Box pl={8} textColor={'blackAlpha.900'} >Supply Chain Control Center</Box>
                        <HStack
                            as={'nav'}
                            spacing={4}
                            display={{ base: 'none', md: 'flex' }}>
                            <Button>aaa</Button>
                            <Button>aaa</Button>
                        </HStack>
                    </HStack>
                    <HStack spacing={8} px={4}>
                        <Button colorScheme={'red'} variant={'solid'} >Connect Wallet</Button>
                        <Avatar
                            size={'md'}
                            src={
                                'https://miro.medium.com/max/600/1*_bLztZTVKgTeRUvkKmrGnQ.png'
                            }
                        />
                    </HStack>
                </Flex>

            </Box>
        </>
    );
}
